import React from 'react';
import { Link } from 'react-router-dom';


const FormSuccess = () => {
    return (
        <div className="d-flex justify-content:center align">
            <h1>WELCOME</h1>
            <img src='img/undraw.svg' alt='success-image' className="w-25 mt-5" />



            <button className=" btn btn-primary mt-5 "> <Link className="logout" to="/">Log out</Link> </button>

        </div>
    )
}

export default FormSuccess;
